import React from 'react'
import './Order.css'
const Order = (props) => {
    return (
        <div className="Order">
            <p>Ingredients: Salad(1)</p>
            <p>Price: <strong>{Number.parseFloat(props.price).toFixed(2)}</strong></p>
        </div>
    )
}

export default Order
